import Grid from "@mui/material/Grid";
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import FormField from "layouts/pages/account/components/FormField";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';
import SuiButton from "components/SuiButton";
// import { Link } from "react-router-dom";
import DataTable from "examples/Tables/DataTable";
import SuiSelect from "components/SuiSelect";
import datatable3 from "layouts/authentication/error/datatable3";

function Charts() {

  const passwordRequirements = [

  ];

  const renderPasswordRequirements = passwordRequirements.map((item, key) => {
    const itemKey = `element-${key}`;

    return (

      <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
        <SuiTypography
          variant="button"
          textColor="text"
          fontWeight="regular"
          verticalAlign="middle"
        >
          {item}
        </SuiTypography>
      </SuiBox>
    );
  });

  return (

    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox p={2}>
        <Card id="profile">
          <SuiBox p={3}>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h5" fontWeight="medium">
                  AUM (User Wise)
                  <a href="/holding/ amcwiseaum">AUM (AMC Wise)</a>
                  <a href="/holding/ schemety.peamc"> AUM (Scheme Type Wise)</a>
                  <a href="/holding/ schemewise"> AUM (Scheme Wise)  </a>
                  <a href="/holding/ userwiseaum"> AUM (RTA wise) </a>
                  </SuiTypography>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>
      <SuiBox p={2}>
        <Card id="change-password">
          <SuiBox p={3}>
            <DataTable table={datatable3} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
      </SuiBox>
    </DashboardLayout>
  );
}

export default Charts;
